//IMPORTS
import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { BrowserRouter as Router, withRouter } from 'react-router-dom';

//ROUTER SETUP
const AppWithRouter = withRouter( App );


ReactDOM.render(

        <Router>
            <AppWithRouter />
        </Router>

, document.getElementById('root'));
